    const apiUrl ='http://10.10.3.40:8091/api';
    const authAxios  = axios.create({
        baseURL: apiUrl,
        headers: {
            'Authorization':'Bearer'+ accessToken
        }
    });
    return authAxios;

}
export default AxiosConfiguration
